import React, {Component} from 'react';
import { connect } from 'react-redux';
import {Card, CardHeader, CardBody, Button, ButtonGroup} from 'reactstrap';
import { AppSwitch } from '@coreui/react'
import {BootstrapTable, TableHeaderColumn} from 'react-bootstrap-table';
import 'react-bootstrap-table/dist//react-bootstrap-table-all.min.css';
import DbCrud from '../../../Pojo/DbCrud';

class List extends Component {

  constructor(props) {
    super(props);
    datos = [];
    if(this.props.obj.length == 0){
     this.props.history.push('/Geo/CountryList');
    }else{
        this.datos = this.props.obj.forEach(function(index) {
            if(index.documentId == this.props.match.params.idDocument){
                return index.states
            }
        }.bind(this));
    }

    this.state = {
        documentId: this.props.match.params.idDocument,
        statesObj:datos
    };
    //console.log(this.state.statesObj);
  }

  loadStates(){
